import React, {Component} from 'react';

function FilmListing(props){
  return(
    <div className="film-library">
      <div className="film-list">
        {console.log(props.title)}
        <h1 className="section-title">{props.title}</h1>
      </div>
    </div>
  );
}

export default FilmListing;
